import { TextField, Button } from "@material-ui/core";
import { useState } from "react";
import "./ContactPage.scss";
const ContactPage = () => {
  const [values, setValues] = useState({
    firstName: "",
    lastName: "",
    email: "",
    message: "",
  });
  const handleChange = (prop: any) => (event: any) => {
    setValues({ ...values, [prop]: event.target.value });
  };
  const handleSubmit = () => {
    console.log(values);
  };
  return (
    <div className="wholeBackground">
      <div className="contentBackground">
        <div className="content">
          <div className="titleText titlePrimary">Contact</div>

          <div className="contactContainer">
            <div className="inputContainer">
              <div className="textInput slide1">
                <TextField
                  label="First Name:"
                  value={values.firstName}
                  onChange={handleChange("firstName")}
                  InputLabelProps={{
                    style: {
                      color: "var(--theme-text-placeholder)",
                    },
                  }}
                  variant={"filled"}
                  fullWidth={true}
                />
              </div>
              <div className="textInput slide2">
                <TextField
                  label="Last Name:"
                  value={values.lastName}
                  onChange={handleChange("lastName")}
                  variant={"filled"}
                  InputLabelProps={{
                    style: {
                      color: "var(--theme-text-placeholder)",
                    },
                  }}
                  fullWidth={true}
                />
              </div>
            </div>
            <div className="textInput slide3">
              <TextField
                label="Email Address:"
                value={values.email}
                onChange={handleChange("email")}
                variant={"filled"}
                InputLabelProps={{
                  style: {
                    color: "var(--theme-text-placeholder)",
                  },
                }}
                fullWidth={true}
              />
            </div>
            <div className="textInput slide4">
              <TextField
                label="Brief Message:"
                value={values.message}
                onChange={handleChange("message")}
                multiline={true}
                minRows={3}
                variant={"filled"}
                fullWidth={true}
                InputLabelProps={{
                  style: {
                    color: "var(--theme-text-placeholder)",
                  },
                }}
              />
            </div>
            <Button
              variant="contained"
              className="button slide5"
              title={"Submit"}
              onClick={() => handleSubmit()}
            >
              Submit
            </Button>
          </div>
        </div>
      </div>
    </div>
  );
};
export default ContactPage;
